import * as React from "react";

export function Logo(props: React.SVGProps<SVGSVGElement>) {
  // The props passed to this component (like className) will be spread onto the <svg> element.
  // The viewBox attribute helps in scaling the SVG content.
  // Explicit width and height on the SVG root are removed to allow CSS to control its size.
  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      xmlnsXlink="http://www.w3.org/1999/xlink"
      viewBox="0 0 500 500"
      {...props}
    >
      <image
        xlinkHref="data:image/png;base64,.."
        x="0"
        y="0"
        width="500"
        height="500"
        // Adding width="100%" and height="100%" ensures the image scales within the SVG container
        // This is often needed for images within SVGs to respect the SVG dimensions set by CSS.
        style={{ width: '100%', height: '100%' }}
      />
    </svg>
  );
}
